window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"17.1.1","implementation":{"name":"cucumber-jvm","version":"7.1.0"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"16.0.2+7-67"},"os":{"name":"Linux"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1665750837,"nanos":52360653}}},{"source":{"uri":"file:///home/lourdes/Dropbox/Asignaturas/RI-Privada/2022-2023/CWS_git_repository/extension_1_contract_and_payroll_jpa/workspace2/acceptance_tests.cws_extension1Version2/src/test/resources/uo/ri/cws/application/service/contract/Add.feature","data":"Feature: Add a contract for a mechanic\n  As a Manager\n  I want to hire a mechanic\n\n  Scenario: Hire an existing mechanic with no previous contract in force\n     Given the following mechanic\n  \t\t   | dni  \t| name  | surname   | \n         | DNI-1 | Name-1| Surname-1 |  \n\t\tWhen I hire the mechanic with this data\n\t\t      | type | group | pay |\n         | PERMANENT | I | 2000.0 | \n    Then there is a contract in force for the mechanic with the following data\n         | dni  \t| name  | surname   | type | group | pay | settlement |\n         | DNI-1 | Name-1| Surname-1 | PERMANENT | I | 2000.0 | 0 |\n    And contract version is 1\n    And start date is first day next month\n     \n  Scenario: Hire an existing mechanic with a previous contract in force shorter than a year \n   Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state | startDate | pay |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |1-01-2022| 2000.0 |  \n    When I hire the mechanic with this data\n\t\t      |  type | group | pay |\n         |  PERMANENT | I | 2000.0 | \n   Then there is a contract in force for the mechanic with the following data\n         | dni  \t| name  | surname   | type | group | pay | settlement |\n         | DNI-1 | Name-1| Surname-1 | PERMANENT | I | 2000.0 | 0 |\n      And contract version is 1\n    And start date is first day next month\n      And previous contract is terminated with this settlement\n    |settlement |\n    | 0 |\n    \n Scenario: Hire an existing mechanic with a contract in force longer than a year\n    Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state | startDate | pay |\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I | IN_FORCE |1-01-2021| 16800.0 |\n    And several payrolls for all the contracts     \n    When I hire the mechanic with this data\n\t\t      | dni  \t| name  | surname   | type | group | pay |\n         | DNI-2 | Name-2| Surname-2 | PERMANENT | I | 12000.0 | \n   Then there is a contract in force for the mechanic with the following data\n         | dni  \t| name  | surname   | type | group | pay | settlement |\n         | DNI-2 | Name-2| Surname-2 | PERMANENT | I | 12000.0 | 0 |\n    And contract version is 1\n    And start date is first day next month         \n    And previous contract is terminated with this settlement\n    |settlement |\n    | 62.13 |\n #16800 / 365 * 1 anho de antiguedad * 1.35 dias / anho trabajado\n  \n\n  Scenario: Hire an existing mechanic with previous contract terminated\n    Given the following mechanic with a contract terminated\n      | dni  \t| name  | surname   | type | group | state | startDate | pay |\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I | TERMINATED |1-01-2022| 2000.0 |  \n    When I hire the mechanic with this data\n\t\t      |  type | group | pay |\n         |  PERMANENT | I | 2000.0 | \n   Then there is a contract in force for the mechanic with the following data\n         | dni  \t| name  | surname   | type | group | pay | settlement |\n         | DNI-3 | Name-3| Surname-3 | PERMANENT | I | 2000.0 | 0 |\n     And contract version is 1\n    And start date is first day next month\n             \n@BusinessExceptions    \n  Scenario Outline: Try to add a contract for a non existing mechanic\n    When I try to add a contract for ract\n    Then an error happens with an explaining message\n\n@PositiveScenarios\n\n  Scenario: Delete a contract in force\n    Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\n    When I delete the contract\n    Then This contract does not exist any more\n\n  Scenario: Delete a contract terminated\n        Given the following mechanic with a contract terminated\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | TERMINATED|\n    When I delete the contract\n    Then This contract does not exist any more","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///home/lourdes/Dropbox/Asignaturas/RI-Privada/2022-2023/CWS_git_repository/extension_1_contract_and_payroll_jpa/workspace2/acceptance_tests.cws_extension1Version2/src/test/resources/uo/ri/cws/application/service/contract/Delete.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@DeleteContract","id":"eb6eb8a8-70dd-4cc5-a9ab-be72079a50ec"}],"language":"en","keyword":"Feature","name":"Delete a contract","description":"  As a Manager\n  I want to delete a contract (I wrote sth wrong and I want to delete it and then try to do it right)","children":[{"scenario":{"location":{"line":9,"column":3},"tags":[{"location":{"line":7,"column":1},"name":"@IllegalArgumentExceptions","id":"342749f9-7e7f-4203-bc5c-024c7c62cbaf"}],"keyword":"Scenario Outline","name":"Try to delete a null contract id","description":"","steps":[{"location":{"line":10,"column":5},"keyword":"When ","text":"I try to delete a null contract id","id":"9f949fca-2d27-4375-93fc-0031827d3df2"},{"location":{"line":11,"column":5},"keyword":"Then ","text":"argument is rejected with an explaining message","id":"5f227c5f-5625-44a0-9872-836be1e29488"}],"examples":[],"id":"4ef64fad-6c44-4a0e-9b85-a78932 rio: Find contracts by mechanic id for an existent mechanic with no contracts \n    When I search contracts for a non existent mechanic\n    Then List of contracts summary is empty\n    \n  Scenario: Find contracts by mechanic id for an existent mechanic with no contracts in force and one terminated contract\n      Given the following mechanic\n      | dni  \t| name  | surname   | \n      | DNI-3 | Name-3| Surname-3 | \n    And the following relation of contracts for this mechanic\n          | type | group | state | startDate | endDate |\n          | PERMANENT | I | TERMINATED | 1-1-2000 | 30-11-2000 |\n          | PERMANENT | II | TERMINATED | 1-1-2002 | 30-6-2002|    \n    When I search contracts for the mechanic\n    Then All contracts summary are found\n    And There is no contract in force\n\n  Scenario: Find contracts by mechanic id for existent mechanic with several contracts terminated and one contract in force with no payrolls\n      Given the following mechanic\n      | dni  \t| name  | surname   |\n      | DNI-4 | Name-4| Surname-4 | \n     Given the following relation of contracts for this mechanic\n      \n          | type | group | state | startDate | endDate |\n          | PERMANENT | I | TERMINATED | 1-1-2000 | 30-11-2000 |\n          | PERMANENT | II | IN_FORCE | 1-1-2022 | |          \n    When I search contracts for the mechanic\n    Then All contracts summary are found\n        \n  Scenario: Find contracts by mechanic id for an existent mechanic with several contracts terminated and one contract in force with several payrolls\n      Given the following mechanic\n      | dni  \t| name  | surname   |\n      | DNI-5 | Name-5| Surname-5 | \n     And the following relation of contracts for this mechanic\n     \n          | type | group | state | startDate | endDate |\n          | PERMANENT | I | TERMINATED | 1-1-2000 | 30-11-2000 |\n          | PERMANENT | II | IN_FORCE | 1-1-2022 | |        \n          \n    \n      And several payrolls for all the c a contract with wrong wage <money>\n    Then argument is rejected with an explaining message\n    \n    Examples: \n      | money  |\n      | 0.0    | \n      | -100.0 | \n      \n  @BusinessExceptions\n  Scenario: Try to update a non existing contract  \n    When I try to update a non existing contract\n    Then an error happens with an explaining message\n  \n  Scenario: Try to update a contract terminated \n       Given the following mechanic with a contract terminated\n      | dni  \t| name  | surname   | type | group | state | startDate | endDate |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | TERMINATED | 1-1-2022 | 25-5-2022 |\n      When I try to update a terminated contract \n    Then an error happens with an explaining message\n    \n  \n  Scenario: Try to update a contract with wrong end date\n       Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state | startDate | endDate |\n      | DNI-1 | Name-1| Surname-1 | FIXED_TERM | I | IN_FORCE | 1-1-2022 | 1-1-2025 |\n    When I try to update a fixed term contract with end date earlier than start date\n    Then an error happens with an explaining message\n\n  @OK\n  Scenario: Update only end date\n       Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state | startDate | endDate | pay |\n      | DNI-1 | Name-1| Surname-1 | FIXED_TERM | I | IN_FORCE | 1-1-2022 | 1-1-2025 | 30000 |\n    When I update the end date of the contract to\n    | newEndDate |\n    | 1-12-2025 |\n    Then updatable fields are updated and all other fields remain the same\n\n  Scenario: Update only wage\n       Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state | startDate | endDate | pay |\n      | DNI-1 | Name-1| Surname-1 | FIXED_TERM | I | IN_FORCE | 1-1-2022 | 1-1-2025 | 30000 |\n    When I update wage of the contract to\n    | wage |\n    | 50000.0 | h an explaining message\t \n\n\t\tScenario: Try to del a contract type with contracts in terminated\n    Given the following relation of mechanics with a contract\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | TERMINATED |\n    \tWhen I try to del contract type PERMANENT\n\t    Then an error happens with an explaining message\t \n\n\t @PositiveCases\n\t Scenario: Del a contract type\n\t \t\tGiven a contract type with no contracts\n\t \t\tWhen I del this contract type\n\t \t\tThen This contract type is deleted","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///home/lourdes/Dropbox/Asignaturas/RI-Privada/2022-2023/CWS_git_repository/extension_1_contract_and_payroll_jpa/workspace2/acceptance_tests.cws_extension1Version2/src/test/resources/uo/ri/cws/application/service/contracttype/Delete.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@DeleteContractType","id":"dfec4aeb-cd67-42e4-bfb9-387a9c9d7a42"}],"language":"en","keyword":"Feature","name":"Delete a contract type","description":"  As a Manager\n  I need to delete a contract type. Perhaps, I typed something wrong","children":[{"scenario":{"location":{"line":7,"column":4},"tags":[{"location":{"line":6,"column":3},"name":"@IllegalArgumentException","id":"aeea511d-ad48-4148-ae8a-de608d408efc"}],"keyword":"Scenario","name":"Try to del a contract type with null arg","description":"","steps":[{"location":{"line":8,"column":5},"keyword":"When ","text":"I try to del a contract type with null argument","id":"6e92043b-cc29-4425-971d-8ce9fd3e5009"},{"location":{"line":9,"column":6},"keyword":"Then ","text":"argument is rejected with an explaining message","id":"f649c747-2703-4a40-bde9-9b761a61756e"}],"examples":[],"id":"1cad87e7-cdc9-485e-9197-d62f1769e638"}},{"scenario":{"location":{"line":11,"column":4},"tags":[],"keyword":"Scenario Outline","name":"Try to del a contract type FORCE |1-01-2022 |\n      | DNI-6 | Name-6| Surname-6 | PERMANENT | I |IN_FORCE |1-01-2022 |\n    When we read all mechanics with contract in force\n    Then we get the following list of mechanics \n      | mechanic\t\t\t\t\t\t\t\t |\n      | DNI-4,Name-4,Surname-4 |\n      | DNI-5,Name-5,Surname-5 |\n      | DNI-6,Name-6,Surname-6 | \t\t\n      \n  Scenario Outline: Find all existing mechanics with contract in force when there are some mechanics with contract in force\n   Given the following relation of mechanics with a contract in force\n      | dni  \t| name  | surname   | type | group | state | startDate |\n      | DNI-7 | Name-7| Surname-7 | PERMANENT | I | IN_FORCE | 1-01-2022 |\n      |DNI-8 | Name-8| Surname-8| PERMANENT | I |IN_FORCE |1-01-2022 |\n      |  DNI-9 | Name-9| Surname-9 | PERMANENT | I |IN_FORCE |1-01-2022 |\n    And the following relation of mechanics with a contract terminated\n      | dni  \t| name  | surname   | type | group | state | startDate |\n      | DNI-10 | Name-10| Surname-10 | PERMANENT | II |TERMINATED |1-01-2022 |\n      | DNI-11 | Name-11| Surname-11 |PERMANENT | II |TERMINATED|1-01-2022 |\n          When we read all mechanics with contract in force\n    Then we get the following list of mechanics \n      | mechanic\t\t\t\t\t\t\t\t |\n      | DNI-7,Name-7,Surname-7 |\n      | DNI-8,Name-8,Surname-8 |\n      | DNI-9,Name-9,Surname-9 | \t            ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///home/lourdes/Dropbox/Asignaturas/RI-Privada/2022-2023/CWS_git_repository/extension_1_contract_and_payroll_jpa/workspace2/acceptance_tests.cws_extension1Version2/src/test/resources/uo/ri/cws/application/service/mechanic/FindWithContractInForce.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Find all mechanics with contract in force","description":"  As a Manager\n  I need to know current mechanics ","children":[{"scenario":{"location":{"line":5,"co  type with no contracts\n Given the following relation of mechanics with a contract\n      | dni  \t| name  | surname   | type | group | state | startDate |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | TERMINATED | 1-1-2022 |\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I |TERMINATED |1-1-2022 |\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I |TERMINATED |1-1-2022 |\n    When I search mechanics in contract type PERMANENT\n    Then an empty list is returned\n    \n  Scenario: Find mechanics in an existent contract type \n     Given the following relation of mechanics with a contract in force\n      | dni  \t| name  | surname   | type | group | state | startDate |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |1-01-2022 |\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I |IN_FORCE |1-01-2022|\n      | DNI-4 | Name-4| Surname-4 | TEMPORARY | II |IN_FORCE |1-01-2022|\n    And the following relation of mechanics with a contract terminated  \n      | dni  \t| name  | surname   | type | group | state | startDate |\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I |TERMINATED |1-01-2022 |\n    When I search mechanics in contract type PERMANENT\n    Then we get the following list of mechanics \n      | mechanic\t\t\t\t\t\t\t\t |\n      | DNI-1,Name-1,Surname-1 |\n      | DNI-2,Name-2,Surname-2 |","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///home/lourdes/Dropbox/Asignaturas/RI-Privada/2022-2023/CWS_git_repository/extension_1_contract_and_payroll_jpa/workspace2/acceptance_tests.cws_extension1Version2/src/test/resources/uo/ri/cws/application/service/mechanic/FindWithContractType.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Find mechanics with contract in force in contract type","description":"","children":[{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@FindMechanicsWithContractInFoceInContractType"," ven the following relation of mechanics with a contract\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I | IN_FORCE |\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I | IN_FORCE |\n    And several payrolls for all the contracts     \n  \tWhen I search payrolls\n   \tThen All payrolls summary are returned\n    \t\n  @getPayrollDetails\n  \t@IllegalArgumentException\n\t  Scenario: Try to find a payroll with null id\n\t  \tWhen I try to find payroll with null argument\n  \t  Then argument is rejected with an explaining message\n\n\t  Scenario Outline: Try to find a payroll with invalid id\n  \t  When I try to find payroll with <id> argument\n    \tThen argument is rejected with an explaining message\n \t\tExamples:\n \t\t|  id  |\n \t\t| \"\"   |\n \t\t| \"   \"|\n\t  \n\t\t@PositiveCases\n\t\tScenario: Find a non existent payroll \n    \tWhen I find a payroll with a non existent id\n    \tThen Returns empty\n    \t\n\t\tScenario: Find an existent payroll \n     Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state | startDate |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE | 1-5-2022|\n  \tAnd One payroll for this contract this month \n   \tWhen I search a payroll by id\n   \tThen This payroll is returned\n    \t\n\t@getAllPayrollsForMechanic\n  \t@IllegalArgumentException\n\t  Scenario: Try to find a payroll with null mechanic id\n\t  \tWhen I try to find payrolls with null mechanic id\n  \t  Then argument is rejected with an explaining message\n\n\t  Scenario Outline: Try to find a payroll with invalid mechanic id\n  \t  When I try to find payrolls with mechanic <id> argument\n    \tThen argument is rejected with an explaining message\n \t\tExamples:\n \t\t|  id  |\n \t\t| \"\"   |\n \t\t| \"   \"|\n \t\t\t\n  \t@BusinessException\n\t\tScenario: Find payrolls for a non existent mechanic \n    \tWhen I try to find payrolls with a non existent id\n\t    Then an error happens with an explaining message\n \t\t\t\n\t\t@PositiveCases\n\t\n\t  Scenario: Find payrolls for a mechanid with no payroll \n     Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\n\t    When I search payrolls for the mechanic\n    \tThen Result is empty\n\t    \n\t  Scenario: Find payrolls for a mechanid with one payroll \n     Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\n\t    And One payroll for this contract this month\n\t    When I search payrolls for the mechanic\n\t    Then The payroll summary for this mechanic is found\n\t    \n\t  Scenario: Find payrolls for a mechanid with several payroll \n     Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\n    And several payrolls \n\t    When I search payrolls for the mechanic\n\t    Then All payroll summaries for this mechanic are found     \t\t\t\n \t\t\t\t\t\n\t@getAllPayrollsForProfessionalGroup\n  \t@IllegalArgumentException\n\t  Scenario: Try to find a payroll with null professional group name\n\t  \tWhen I try to find payrolls with null professional group name\n  \t  Then argument is rejected with an explaining message\n\n\t  Scenario Outline: Try to find a payroll with invalid professional group name\n  \t  When I try to find payrolls with professional group <name> argument\n    \tThen argument is rejected with an explaining message\n \t\tExamples:\n \t\t|  name  |\n \t\t| \"\"   |\n \t\t| \"   \"|\n \t\t\t\n  \t@BusinessException\n\t\tScenario: Find payrolls for a non existent professional group \n    \tWhen I try to find payrolls with a non existent professional group name\n\t    Then an error happens with an explaining message\n \t\t\t\n\t\t@PositiveCases\n\t\n\t  Scenario: Find payrolls for a professional group with no payroll \n    Given the following relation of mechanics with a contract\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I |IN_FORCE |\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I |IN_FORCE |\n\t    When I search payrolls for the professional group \n    \tThen Result is empty\n\t    \n\t  Scenario: Find payrolls for a professional group with one payroll \n     Given the following mechanic with a contract in force\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\n\t    And One payroll for this contract this month\n \t    When I search payrolls for the professional group\n\t    Then The payroll summary for this professional group is found\n\t    \n\t  Scenario: Find payrolls for a professional group with several payroll \n\t  Given  the following relation of mechanics with a contract\n      | dni  \t| name  | surname   | type | group | state |\n      | DNI-1 | Name-1| Surname-1 | PERMANENT | I | IN_FORCE |\n      | DNI-2 | Name-2| Surname-2 | PERMANENT | I |IN_FORCE |\n      | DNI-3 | Name-3| Surname-3 | PERMANENT | I |IN_FORCE |\n       And several payrolls for all the contracts\n\t    When I search payrolls for the professional group \n    \tThen All payroll summaries for this professional group are found\n\t  \n\t  ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///home/lourdes/Dropbox/Asignaturas/RI-Privada/2022-2023/CWS_git_repository/extension_1_contract_and_payroll_jpa/workspace2/acceptance_tests.cws_extension1Version2/src/test/resources/uo/ri/cws/application/service/payroll/FindPayrolls.feature","feature":{"location":{
